import React, { useState } from 'react';
import './App.css';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Select from 'react-select';

function App() {
    const [rateData, setRateData] = useState({});
    const [inputProvince, setInputProvince] = useState(null);
    const handleRateChange = (event) => {
        setRateData({
            ...rateData,
            [event.target.name]: event.target.value
        })
    };
    const handleInputProvince = (e) => {
        setInputProvince(e.value);
    };


    const countryOptions = [
        { value: "CA", label: "Canada" },
        { value: "US", label: "USA" },
    ];
    const provinceOptions = [
        { value: "ON", label: "Ontario" },
        { value: "AB", label: "Alberta" },
        { value: "BC", label: "British Columbia" },
        { value: "NS", label: "Nova Scotia" },
        { value: "NU", label: "Nunavut" },
    ];
    const handleClick = () => {
        alert(JSON.stringify(rateData));
    };
    function handleSubmit(e) {
    // Prevent the browser from reloading the page
    e.preventDefault();
    alert(JSON.stringify(rateData));

    // Read the form data
    const form = e.target;
    const formData = new FormData(form);

    // You can pass formData as a fetch body directly:
    //fetch('/some-api', { method: form.method, body: formData });

    // Or you can work with it as a plain object:
    const formJson = Object.fromEntries(formData.entries());
    console.log(formJson);
  }
  return (
      <Container>
          <br/>
          <br/>
          <Row>
              <Col>Origin Address</Col>
              <Col>Destination Address</Col>
          </Row>
          <Row>
              <Col>
                  <label>
                      Address Line 1: <input name="rateData.inputOriginAddressLine" onChange={handleRateChange} defaultValue="" />
                  </label>
                  <label>
                      City: <br/><input name="rateData.inputOriginCity" onChange={handleRateChange} defaultValue="" />
                  </label>
                  <label>
                      Province: <br/><Select name="rateData.inputOriginProvince" onChange={handleInputProvince} options={provinceOptions} />
                  </label>
                  <label>
                      Company Name: <br/><input name="rateData.inputOriginCompanyName" onChange={handleRateChange} defaultValue="" />
                  </label>
              </Col>
              <Col>
                  <label>
                      PostalCode: <input name="rateData.inputOriginPostalCode" onChange={handleRateChange} defaultValue="" />
                  </label>
                  <label>
                      Country: <br/> <Select name="rateData.inputOriginCountry" onChange={handleRateChange} options={countryOptions} />
                  </label>
                  <label>
                      Phone Number: <br/><input name="rateData.inputOriginPhoneNumber" onChange={handleRateChange} defaultValue="" />
                  </label>
                  <label>
                      Attention: <br/><input name="rateData.inputOriginAttention" onChange={handleRateChange} defaultValue="" />
                  </label>

              </Col>
              <Col>
                  <label>
                      Address Line 1: <input name="rateData.inputDestinationAddressLine" onChange={handleRateChange} defaultValue="" />
                  </label>
                  <label>
                      City: <br/><input name="rateData.inputDestinationCity" onChange={handleRateChange} defaultValue="" />
                  </label>
                  <label>
                      Province: <br/><Select name="rateData.inputDestinationProvince" onChange={handleRateChange} options={provinceOptions} />
                  </label>
                  <label>
                      Company Name: <br/><input name="rateData.inputDestinationCompanyName" onChange={handleRateChange} defaultValue="" />
                  </label>
              </Col>
              <Col>
                  <label>
                      PostalCode: <input name="rateData.inputDestinationPostalCode" onChange={handleRateChange} defaultValue="" />
                  </label>
                  <label>
                      Country: <br/> <Select name="rateData.inputDestinationCountry" onChange={handleRateChange} options={countryOptions} />
                  </label>
                  <label>
                      Phone Number: <br/><input name="rateData.inputDestinationPhoneNumber" onChange={handleRateChange} defaultValue="" />
                  </label>
                  <label>
                      Attention: <br/><input name="rateData.inputDestinationAttention" onChange={handleRateChange} defaultValue="" />
                  </label>
              </Col>
          </Row>
          <br/>
          Package Information
          <br/>
          <Row>
              <Col>
                  <label>
                      Length: <br/><input name="rateData.inputLength" onChange={handleRateChange} defaultValue="" />
                  </label>
              </Col>
              <Col>
              <label>
                  Width: <br/><input name="rateData.inputWidth" onChange={handleRateChange} defaultValue="" />
              </label>
              </Col>
              <Col>
                  <label>
                      Height: <br/><input name="rateData.inputHeight" onChange={handleRateChange} defaultValue="" />
                  </label>
              </Col>
              <Col>
              <label>
                  Weight: <br/><input name="rateData.inputWeight" onChange={handleRateChange} defaultValue="" />
              </label>
              </Col>
          </Row>
          <br/>
          <br/>
          <br/>
          <Row>
              <button onClick={handleClick}>Get Rates</button>
          </Row>

      </Container>

  );
}

export default App;
